/* eslint-disable jsx-a11y/alt-text */
import React, { Component } from 'react';
import { ListItem, ListInfo } from '../style';
import { connect } from 'react-redux';

class List extends Component {
  render() { 
    return (
      <ListItem>
        <img className="pic" src="https://newscorp.com/wp-content/uploads/2021/04/homepage-wallstreetjournal.jpg?w=1440&h=710&crop=1" />
        <ListInfo>
          <h3>Sydney lockdown extended with more restrictions as NSW records 642 cases</h3>
          <p>NSW Premier Gladys Berejiklian has extended the lockdown for Greater Sydney until the end of September after NSW recorded 642 new local cases and four deaths on Friday.</p>
        </ListInfo>
      </ListItem>
    );
  }
}

export default List;
